function explode(speed: number = 2, size: number = 1): ExplodeComp {
	let time = 0;
	return {
		id: "explode",
		require: [ "scale", ],
		update() {
			const s = Math.sin(time * speed) * size;
			if (s < 0) {
				destroy(this);
			}
			this.scale = vec2(s);
			time += dt();
		},
	};
}

let kaSprite = null;
let boomSprite = null;

loadSprite(null, kaSrc).then((spr) => kaSprite = spr);
loadSprite(null, boomSrc).then((spr) => boomSprite = spr);

// TODO: use children obj
function addKaboom(p: Vec2, opt: BoomOpt = {}): Kaboom {

	const speed = (opt.speed || 1) * 5;
	const s = opt.scale || 1;

	const boom = add([
		pos(p),
		sprite(boomSprite),
		scale(0),
		stay(),
		origin("center"),
		explode(speed, s),
		...(opt.boomComps ?? (() => []))(),
	]);

	const ka = add([
		pos(p),
		sprite(kaSprite),
		scale(0),
		stay(),
		origin("center"),
		timer(0.4 / speed, () => ka.use(explode(speed, s))),
		...(opt.kaComps ?? (() => []))(),
	]);

	return {
		destroy() {
			destroy(ka);
			destroy(boom);
		},
	};

}

function frames() {
